content:
import React, { useState, useEffect, useCallback } from 'react';
import { View, StyleSheet, Dimensions, TouchableOpacity, ScrollView, Modal, Image, TextInput, Platform, PermissionsAndroid } from 'react-native';
import { Text, Button, Card, useTheme, SegmentedButtons, Chip, Snackbar, ActivityIndicator, IconButton, ProgressBar } from 'react-native-paper';
import Icon from 'react-native-vector-icons/MaterialCommunityIcons';
import { useSafeAreaInsets } from 'react-native-safe-area-context';
import { AppHeader } from '../../components/common/AppHeader';
import { pick, types } from '@react-native-documents/picker';
import { Skeleton } from '../../components/common/Skeleton';
import Pdf from 'react-native-pdf';
import ReactNativeBlobUtil from 'react-native-blob-util';
import {
    processDocument as processDocumentService,
    getPdfPageCount,
    readFileAsBytes,
    ProcessedDocument,
    ProcessingProgress,
    ProcessSettings
} from '../../services/documentProcessor';

const { width: SCREEN_WIDTH, height: SCREEN_HEIGHT } = Dimensions.get('window');

const getFileType = (name: string, type?: string) => {
    if (type === 'application/pdf' || name?.toLowerCase().endsWith('.pdf')) return 'pdf';
    if (type?.startsWith('image/') || /\.(jpg|jpeg|png|webp)$/i.test(name || '')) return 'image';
    if (/\.(doc|docx)$/i.test(name || '')) return 'doc';
    if (/\.(ppt|pptx)$/i.test(name || '')) return 'slide';
    return 'other';
};

// Helper function to parse page range and calculate page count
const parsePageRange = (range: string, totalPages: number): number => {
    if (!range || range.trim().toLowerCase() === 'all') return totalPages;

    try {
        const parts = range.split(',').map(p => p.trim());
        const pageSet = new Set<number>();

        for (const part of parts) {
            if (part.includes('-')) {
                const [start, end] = part.split('-').map(n => parseInt(n.trim()));
                if (isNaN(start) || isNaN(end)) continue;
                for (let i = Math.max(1, start); i <= Math.min(totalPages, end); i++) {
                    pageSet.add(i);
                }
            } else {
                const page = parseInt(part);
                if (!isNaN(page) && page >= 1 && page <= totalPages) {
                    pageSet.add(page);
                }
            }
        }

        return pageSet.size > 0 ? pageSet.size : totalPages;
    } catch {
        return totalPages;
    }
};

// Backend pricing service (simulated)
const fetchPricingFromBackend = async (settings: any, fileType: string): Promise<{
    perPage: number;
    total: number;
    currency: string;
    isLoading?: boolean;
}> => {
    // Simulate network delay
    await new Promise(resolve => setTimeout(() => resolve(undefined), 500));

    // For images, always 1 page
    let pages = fileType === 'image' ? 1 : settings.totalPages || 10;

    // For PDFs, parse page range if specified
    if (fileType === 'pdf' && settings.pageRange && settings.pageRange !== 'all') {
        pages = parsePageRange(settings.pageRange, settings.totalPages || 10);
    }

    const copies = settings.copies || 1;

    // Base pricing from backend
    const bwRate = 2;
    const colorRate = settings.colorMode === 'color' ? 5 : 2;

    const sideMultiplier = settings.sides === 'double' ? 0.8 : 1;

    let pageSizeMultiplier = 1;
    if (settings.pageSize === 'A3') pageSizeMultiplier = 1.5;

    const perPage = Math.round(colorRate * sideMultiplier * pageSizeMultiplier * 100) / 100;
    const total = Math.round(perPage * pages * copies);

    return { perPage, total, currency: '' };
};

export const DocumentUpload = ({ navigation, route }: { navigation: any; route?: any }) => {
    const theme = useTheme();
    const insets = useSafeAreaInsets();
    const existingDoc = route?.params?.document;
    const presetSettings = route?.params?.presetSettings;
    const initialPrinter = route?.params?.printer;

    const [document, setDocument] = useState<any>(existingDoc || null);
    const [selectedPrinter, setSelectedPrinter] = useState<any>(initialPrinter || null);
    const [activeTab, setActiveTab] = useState('basic');
    const [pricing, setPricing] = useState({ perPage: 2, total: 0, currency: '' });
    const [errorMsg, setErrorMsg] = useState<string | null>(null);
    const [isPickerOpen, setIsPickerOpen] = useState(false);
    const [isPricingLoading, setIsPricingLoading] = useState(false);

    // Preview Modal State
    const [isPreviewVisible, setIsPreviewVisible] = useState(false);
    const [currentPreviewPage, setCurrentPreviewPage] = useState(1);

    // Document Processing State
    const [processedDocument, setProcessedDocument] = useState<ProcessedDocument | null>(null);
    const [isProcessing, setIsProcessing] = useState(false);
    const [processingProgress, setProcessingProgress] = useState<ProcessingProgress | null>(null);
    const [actualPageCount, setActualPageCount] = useState<number>(0);

    const [settings, setSettings] = useState({
        copies: 1,
        colorMode: 'bw',
        sides: 'single',
        orientation: 'portrait',
        pageSize: 'A4',
        pagesPerSheet: 1,
        totalPages: existingDoc?.pages || 10,
        binding: false,
        pageRange: 'all',
        ...presetSettings
    });

    const fileType = document ? getFileType(document.name, document.type) : 'other';

    // Auto-open picker if no document provided
    useEffect(() => {
        if (!existingDoc && !document && !isPickerOpen) {
            const timer = setTimeout(() => {
                handlePickDocument();
            }, 300);
            return () => clearTimeout(timer);
        }
    }, []);

    // Update printer if returned from selection
    useEffect(() => {
        if (route?.params?.selectedPrinter) {
            setSelectedPrinter(route.params.selectedPrinter);
        }
    }, [route?.params?.selectedPrinter]);

    // Reset preview page when page range changes
    useEffect(() => {
        setCurrentPreviewPage(1);
    }, [settings.pageRange]);

    // Fetch pricing when settings change
    useEffect(() => {
        updatePricing();
    }, [settings, fileType]);

    // Process document when settings change
    useEffect(() => {
        if (document && fileType === 'pdf') {
            processDocumentWithSettings();
        }
    }, [document, settings.pageRange, settings.colorMode, settings.pagesPerSheet, settings.orientation]);

    // Get actual page count when document is loaded
    useEffect(() => {
        const fetchPageCount = async () => {
            if (document && fileType === 'pdf') {
                try {
                    const bytes = await readFileAsBytes(document.uri);
                    const count = await getPdfPageCount(bytes);
                    setActualPageCount(count);
                    updateSetting('totalPages', count);
                } catch (error) {
                    console.error('Error getting page count:', error);
                }
            } else if (fileType === 'image') {
                setActualPageCount(1);
                updateSetting('totalPages', 1);
            }
        };
        fetchPageCount();
    }, [document]);

    const processDocumentWithSettings = useCallback(async () => {
        if (!document || fileType !== 'pdf') return;

        setIsProcessing(true);
        setProcessingProgress({ stage: 'reading', progress: 0, message: 'Starting...' });

        try {
            const processSettings: ProcessSettings = {
                pageRange: settings.pageRange,
                colorMode: settings.colorMode as 'color' | 'bw',
                pagesPerSheet: settings.pagesPerSheet as 1 | 2 | 4,
                orientation: settings.orientation as 'portrait' | 'landscape',
                copies: settings.copies,
                totalPages: actualPageCount || settings.totalPages,
            };

            const processed = await processDocumentService(
                document.uri,
                'pdf',
                processSettings,
                (progress) => setProcessingProgress(progress)
            );

            setProcessedDocument(processed);
            console.log('Document processed:', processed.pageCount, 'pages');
        } catch (error) {
            console.error('Error processing document:', error);
            setErrorMsg('Failed to process document. Please try again.');
        } finally {
            setIsProcessing(false);
            setProcessingProgress(null);
        }
    }, [document, settings, fileType, actualPageCount]);

    const updatePricing = async () => {
        setIsPricingLoading(true);
        try {
            const price = await fetchPricingFromBackend(settings, fileType);
            setPricing(price);
        } catch (error) {
            console.error('Failed to fetch pricing:', error);
        } finally {
            setIsPricingLoading(false);
        }
    };

    const updateSetting = (key: string, value: any) => {
        setSettings((prev: typeof settings) => ({ ...prev, [key]: value }));
    };

    const requestStoragePermission = async (): Promise<boolean> => {
        if (Platform.OS !== 'android') return true;

        // Android 13+ doesn't need READ_EXTERNAL_STORAGE for SAF
        if (Platform.Version >= 33) return true;

        try {
            const granted = await PermissionsAndroid.request(
                PermissionsAndroid.PERMISSIONS.READ_EXTERNAL_STORAGE,
                {
                    title: 'Storage Permission',
                    message: 'JusPrint needs access to your files to preview documents',
                    buttonNeutral: 'Ask Me Later',
                    buttonNegative: 'Cancel',
                    buttonPositive: 'OK',
                }
            );
            return granted === PermissionsAndroid.RESULTS.GRANTED;
        } catch (err) {
            console.warn('Permission request error:', err);
            return false;
        }
    };

    const handlePickDocument = async () => {
        if (isPickerOpen) return;

        setIsPickerOpen(true);
        try {
            // Request permission first on Android
            const hasPermission = await requestStoragePermission();
            if (!hasPermission) {
                setErrorMsg('Storage permission is required to pick documents.');
                setIsPickerOpen(false);
                return;
            }

            const result = await pick({
                type: [types.pdf, types.docx, types.doc, types.pptx, types.ppt, types.images],
                copyTo: 'cachesDirectory',
            });

            if (result && result.length > 0) {
                const file = result[0];

                console.log('Original URI:', file.uri);
                console.log('Copy URI:', (file as any).fileCopyUri);

                let finalUri = file.uri;

                // For Android, if we have a content:// URI, copy it to cache using ReactNativeBlobUtil
                if (Platform.OS === 'android' && file.uri.startsWith('content://')) {
                    try {
                        // Use fileCopyUri if available, otherwise copy manually
                        if ((file as any).fileCopyUri) {
                            finalUri = (file as any).fileCopyUri;
                        } else {
                            // Fallback: manually copy using ReactNativeBlobUtil
                            const fileName = file.name || `temp_${Date.now()}`;
                            const destPath = `${ReactNativeBlobUtil.fs.dirs.CacheDir}/${fileName}`;

                            await ReactNativeBlobUtil.MediaCollection.copyToInternal(file.uri, destPath);
                            finalUri = `file://${destPath}`;
                        }
                    } catch (copyError) {
                        console.error('Error copying file:', copyError);
                        setErrorMsg('Failed to copy file for preview.');
                        setIsPickerOpen(false);
                        return;
                    }
                }

                console.log('Final URI:', finalUri);

                // Determine file type
                const detectedType = getFileType(file.name || '', file.type || '');
                const isImage = detectedType === 'image';

                setDocument({
                    name: file.name || 'Document',
                    uri: finalUri,
                    type: file.type,
                    size: file.size,
                    pages: isImage ? 1 : 10,
                });
                // For images, always 1 page. For PDFs, default to 10 (or could parse PDF to get actual count)
                updateSetting('totalPages', isImage ? 1 : 10);
                updateSetting('pageRange', 'all');
            }
        } catch (e: any) {
            if (e?.code === 'DOCUMENT_PICKER_CANCELED' || e?.message?.includes('cancel')) {
                // cancelled
            } else {
                console.error('Document picker error:', e);
                setErrorMsg('Failed to pick document. Please try again.');
            }
        } finally {
            setIsPickerOpen(false);
        }
    };

    const handleProceed = () => {
        if (isProcessing) {
            Snackbar.show({
                text: 'Please wait for document processing to complete.',
                duration: Snackbar.LENGTH_SHORT,
            });
            return;
        }

        const docToPass = processedDocument ? {
            ...document,
            uri: processedDocument.uri, // Use processed URI
            pageCount: processedDocument.pageCount,
            originalUri: document.uri // Keep reference to original
        } : document;

        navigation.navigate('PaymentScreen', {
            document: docToPass,
            settings,
            pricing,
            printer: selectedPrinter
        });
    };

    return (
        <View style={styles.container}>
            <AppHeader showLogo={false} title="Document Preview" showBack={true} />

            {/* Printer Selection Bar */}
            <TouchableOpacity
                style={styles.printerBar}
                onPress={() => navigation.navigate('PrinterSelection', { returnRoute: 'DocumentUpload' })}
            >
                <View style={styles.printerInfo}>
                    <View style={[styles.printerIcon, { backgroundColor: theme.colors.primary + '15' }]}>
                        <Icon name="printer" size={20} color={theme.colors.primary} />
                    </View>
                    <View>
                        <Text variant="labelSmall" style={{ color: '#666' }}>Printing to</Text>
                        <Text variant="bodyMedium" style={{ fontWeight: 'bold', color: '#1A1A2E' }}>
                            {selectedPrinter?.location || 'Select Printer'}
                        </Text>
                    </View>
                </View>
                <View style={styles.changeBtn}>
                    <Text style={{ color: theme.colors.primary, fontSize: 11, fontWeight: 'bold' }}>CHANGE</Text>
                    <Icon name="chevron-right" size={16} color={theme.colors.primary} />
                </View>
            </TouchableOpacity>

            <ScrollView
                style={styles.content}
                contentContainerStyle={{ paddingBottom: 100 }}
                showsVerticalScrollIndicator={false}
            >
                {/* Document Preview Section */}
                <View style={styles.previewSection}>
                    {document ? (
                        <View style={styles.previewCard}>
                            <View style={styles.previewContainer}>
                                {/* Processing Indicator */}
                                {isProcessing && (
                                    <View style={{
                                        position: 'absolute',
                                        top: 0,
                                        left: 0,
                                        right: 0,
                                        zIndex: 10,
                                        backgroundColor: 'rgba(0,0,0,0.7)',
                                        padding: 12,
                                        borderTopLeftRadius: 12,
                                        borderTopRightRadius: 12,
                                    }}>
                                        <Text style={{ color: 'white', fontSize: 12, marginBottom: 8 }}>
                                            {processingProgress?.message || 'Processing...'}
                                        </Text>
                                        <ProgressBar
                                            progress={(processingProgress?.progress || 0) / 100}
                                            color={theme.colors.primary}
                                            style={{ height: 4, borderRadius: 2 }}
                                        />
                                    </View>
                                )}

                                {/* Preview Page Representation */}
                                <TouchableOpacity
                                    activeOpacity={0.9}
                                    onPress={() => setIsPreviewVisible(true)}
                                    style={[
                                        styles.previewPage,
                                        settings.orientation === 'landscape' && styles.previewLandscape,
                                        { borderColor: theme.colors.primary, borderWidth: 2, padding: 0, overflow: 'hidden' }
                                    ]}
                                >
                                    {/* Actual Content Render - Use processed document if available */}
                                    {fileType === 'pdf' ? (
                                        <View style={{ flex: 1, width: '100%', backgroundColor: '#fff' }}>
                                            <Pdf
                                                source={{ uri: processedDocument?.uri || document.uri, cache: true }}
                                                style={{ flex: 1, width: '100%' }}
                                                singlePage={true}
                                                page={1}
                                                fitPolicy={0}
                                                trustAllCerts={false}
                                                onError={(error) => console.log('PDF Error:', error)}
                                            />
                                        </View>
                                    ) : fileType === 'image' ? (
                                        <Image
                                            source={{ uri: document.uri }}
                                            style={{ flex: 1, width: '100%' }}
                                            resizeMode="cover"
                                        />
                                    ) : (
                                        <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center', width: '100%', backgroundColor: '#F9F9F9' }}>
                                            <Icon
                                                name={fileType === 'doc' ? 'file-word' : fileType === 'slide' ? 'file-powerpoint' : 'file-document'}
                                                size={48}
                                                color={fileType === 'doc' ? '#2B579A' : fileType === 'slide' ? '#D24726' : '#999'}
                                            />
                                            <Text variant="labelSmall" style={{ color: '#666', marginTop: 8, textAlign: 'center' }}>
                                                {fileType.toUpperCase()}
                                            </Text>
                                        </View>
                                    )}

                                    {/* B&W Indicator Overlay - Simple approach for React Native */}
                                    {settings.colorMode === 'bw' && (fileType === 'pdf' || fileType === 'image') && (
                                        <View style={{
                                            position: 'absolute',
                                            top: 8,
                                            left: 8,
                                            backgroundColor: 'rgba(0,0,0,0.7)',
                                            paddingHorizontal: 8,
                                            paddingVertical: 4,
                                            borderRadius: 4
                                        }}>
                                            <Text style={{ color: 'white', fontSize: 10, fontWeight: 'bold' }}>B&W</Text>
                                        </View>
                                    )}

                                    {/* N-up Indicator */}
                                    {settings.pagesPerSheet > 1 && (
                                        <View style={{
                                            position: 'absolute',
                                            top: 8,
                                            right: 8,
                                            backgroundColor: theme.colors.primary,
                                            paddingHorizontal: 8,
                                            paddingVertical: 4,
                                            borderRadius: 4
                                        }}>
                                            <Text style={{ color: 'white', fontSize: 10, fontWeight: 'bold' }}>{settings.pagesPerSheet}-up</Text>
                                        </View>
                                    )}

                                    {/* Processed Indicator */}
                                    {processedDocument && !isProcessing && (
                                        <View style={{
                                            position: 'absolute',
                                            bottom: 8,
                                            left: 8,
                                            backgroundColor: 'rgba(0,150,0,0.8)',
                                            paddingHorizontal: 8,
                                            paddingVertical: 4,
                                            borderRadius: 4,
                                            flexDirection: 'row',
                                            alignItems: 'center',
                                            gap: 4
                                        }}>
                                            <Icon name="check-circle" size={12} color="white" />
                                            <Text style={{ color: 'white', fontSize: 10, fontWeight: 'bold' }}>
                                                {processedDocument.pageCount} pages
                                            </Text>
                                        </View>
                                    )}

                                    {/* Overlay Action Button */}
                                    <View style={styles.previewOverlayBtn}>
                                        <Icon name="fullscreen" size={20} color="white" />
                                    </View>
                                </TouchableOpacity>

                                {/* Instruction Text */}
                                <Text variant="bodySmall" style={{ color: theme.colors.primary, marginTop: 12, fontWeight: 'bold' }}>
                                    {isProcessing ? 'Processing...' : 'Tap to Preview'}
                                </Text>
                            </View>

                            {/* Page Range Input - Only for PDFs */}
                            {fileType === 'pdf' && (
                                <View style={styles.pageRangeContainer}>
                                    <Text variant="labelMedium" style={{ color: '#666', marginBottom: 4 }}>Page Range</Text>
                                    <TextInput
                                        style={styles.pageRangeInput}
                                        value={settings.pageRange}
                                        onChangeText={(text) => updateSetting('pageRange', text)}
                                        placeholder="e.g., all, 1-5, 1,3,5"
                                        placeholderTextColor="#999"
                                    />
                                    <Text variant="labelSmall" style={{ color: '#999', marginTop: 2 }}>
                                        Selected: {parsePageRange(settings.pageRange, settings.totalPages)} pages
                                    </Text>
                                </View>
                            )}

                            <View style={styles.pageInfo}>
                                <View>
                                    <Text variant="bodySmall" style={{ color: '#666' }}>Pages</Text>
                                    <Text variant="titleMedium" style={{ fontWeight: 'bold' }}>
                                        {fileType === 'image' ? '1' : parsePageRange(settings.pageRange, settings.totalPages)}  {settings.copies}
                                    </Text>
                                </View>
                                <View style={{ alignItems: 'flex-end' }}>
                                    <Text variant="bodySmall" style={{ color: '#666' }}>Estimated Cost</Text>
                                    {isPricingLoading ? (
                                        <ActivityIndicator size="small" color={theme.colors.primary} />
                                    ) : (
                                        <Text variant="headlineSmall" style={{ color: theme.colors.primary, fontWeight: 'bold' }}>
                                            {pricing.currency}{pricing.total}
                                        </Text>
                                    )}
                                </View>
                            </View>
                            <Button
                                compact
                                mode="text"
                                onPress={handlePickDocument}
                                style={{ marginTop: 8 }}
                                disabled={isPickerOpen}
                            >
                                Change Document
                            </Button>
                        </View>
                    ) : (
                        <TouchableOpacity
                            style={styles.uploadBox}
                            onPress={handlePickDocument}
                            disabled={isPickerOpen}
                        >
                            {isPickerOpen ? (
                                <ActivityIndicator size="large" color={theme.colors.primary} />
                            ) : (
                                <Icon name="file-upload-outline" size={48} color={theme.colors.primary} />
                            )}
                            <Text variant="titleMedium" style={{ marginTop: 12 }}>
                                {isPickerOpen ? 'Opening...' : 'Tap to Upload'}
                            </Text>
                            <Text variant="bodySmall" style={{ color: '#666' }}>PDF, DOCX, PPT, Images</Text>
                        </TouchableOpacity>
                    )}
                </View>

                {/* Settings Section */}
                {document && (
                    <View style={styles.settingsSection}>
                        <SegmentedButtons
                            value={activeTab}
                            onValueChange={setActiveTab}
                            buttons={[
                                { value: 'basic', label: 'Basic' },
                                { value: 'advanced', label: 'Advanced' },
                            ]}
                            style={styles.tabs}
                        />

                        {activeTab === 'basic' ? (
                            <View style={styles.settingsGrid}>
                                {/* Color Mode */}
                                <View style={styles.settingRow}>
                                    <Text variant="bodyMedium">Print Type</Text>
                                    <View style={styles.optionButtons}>
                                        <TouchableOpacity
                                            style={[styles.optionBtn, settings.colorMode === 'bw' && styles.optionBtnActive]}
                                            onPress={() => updateSetting('colorMode', 'bw')}
                                        >
                                            <Text style={settings.colorMode === 'bw' ? styles.optionTextActive : styles.optionText}>B&W</Text>
                                        </TouchableOpacity>
                                        <TouchableOpacity
                                            style={[styles.optionBtn, settings.colorMode === 'color' && styles.optionBtnActive]}
                                            onPress={() => updateSetting('colorMode', 'color')}
                                        >
                                            <Text style={settings.colorMode === 'color' ? styles.optionTextActive : styles.optionText}>Color</Text>
                                        </TouchableOpacity>
                                    </View>
                                </View>

                                {/* Sides */}
                                <View style={styles.settingRow}>
                                    <Text variant="bodyMedium">Sides</Text>
                                    <View style={styles.optionButtons}>
                                        <TouchableOpacity
                                            style={[styles.optionBtn, settings.sides === 'single' && styles.optionBtnActive]}
                                            onPress={() => updateSetting('sides', 'single')}
                                        >
                                            <Text style={settings.sides === 'single' ? styles.optionTextActive : styles.optionText}>Single</Text>
                                        </TouchableOpacity>
                                        <TouchableOpacity
                                            style={[styles.optionBtn, settings.sides === 'double' && styles.optionBtnActive]}
                                            onPress={() => updateSetting('sides', 'double')}
                                        >
                                            <Text style={settings.sides === 'double' ? styles.optionTextActive : styles.optionText}>Double</Text>
                                        </TouchableOpacity>
                                    </View>
                                </View>

                                {/* Copies */}
                                <View style={styles.settingRow}>
                                    <Text variant="bodyMedium">Copies</Text>
                                    <View style={styles.quantityControl}>
                                        <TouchableOpacity
                                            style={styles.qtyBtn}
                                            onPress={() => updateSetting('copies', Math.max(1, settings.copies - 1))}
                                        >
                                            <Icon name="minus" size={18} />
                                        </TouchableOpacity>
                                        <Text variant="titleMedium" style={{ minWidth: 30, textAlign: 'center' }}>{settings.copies}</Text>
                                        <TouchableOpacity
                                            style={styles.qtyBtn}
                                            onPress={() => updateSetting('copies', settings.copies + 1)}
                                        >
                                            <Icon name="plus" size={18} />
                                        </TouchableOpacity>
                                    </View>
                                </View>
                            </View>
                        ) : (
                            <View style={styles.settingsGrid}>
                                {/* Orientation */}
                                <View style={styles.settingRow}>
                                    <Text variant="bodyMedium">Orientation</Text>
                                    <View style={styles.optionButtons}>
                                        <TouchableOpacity
                                            style={[styles.optionBtn, settings.orientation === 'portrait' && styles.optionBtnActive]}
                                            onPress={() => updateSetting('orientation', 'portrait')}
                                        >
                                            <Text style={settings.orientation === 'portrait' ? styles.optionTextActive : styles.optionText}>Portrait</Text>
                                        </TouchableOpacity>
                                        <TouchableOpacity
                                            style={[styles.optionBtn, settings.orientation === 'landscape' && styles.optionBtnActive]}
                                            onPress={() => updateSetting('orientation', 'landscape')}
                                        >
                                            <Text style={settings.orientation === 'landscape' ? styles.optionTextActive : styles.optionText}>Landscape</Text>
                                        </TouchableOpacity>
                                    </View>
                                </View>

                                {/* Pages Per Sheet */}
                                <View style={styles.settingRow}>
                                    <Text variant="bodyMedium">Pages/Sheet</Text>
                                    <View style={styles.optionButtons}>
                                        {[1, 2, 4].map(n => (
                                            <TouchableOpacity
                                                key={n}
                                                style={[styles.optionBtn, settings.pagesPerSheet === n && styles.optionBtnActive, { minWidth: 40 }]}
                                                onPress={() => updateSetting('pagesPerSheet', n)}
                                            >
                                                <Text style={settings.pagesPerSheet === n ? styles.optionTextActive : styles.optionText}>{n}</Text>
                                            </TouchableOpacity>
                                        ))}
                                    </View>
                                </View>

                                {/* Page Size */}
                                <View style={styles.settingRow}>
                                    <Text variant="bodyMedium">Page Size</Text>
                                    <View style={styles.optionButtons}>
                                        {['A4', 'A3', 'Letter'].map(size => (
                                            <TouchableOpacity
                                                key={size}
                                                style={[styles.optionBtn, settings.pageSize === size && styles.optionBtnActive]}
                                                onPress={() => updateSetting('pageSize', size)}
                                            >
                                                <Text style={settings.pageSize === size ? styles.optionTextActive : styles.optionText}>{size}</Text>
                                            </TouchableOpacity>
                                        ))}
                                    </View>
                                </View>
                            </View>
                        )}
                    </View>
                )}
            </ScrollView>

            {/* Bottom Bar */}
            {document && (
                <View style={[styles.bottomBar, { paddingBottom: insets.bottom + 16 }]}>
                    <View>
                        <Text variant="bodySmall" style={{ color: '#666' }}>
                            {(fileType === 'image' ? 1 : parsePageRange(settings.pageRange, settings.totalPages)) * settings.copies} pages total
                        </Text>
                        {isPricingLoading ? (
                            <Skeleton height={28} width={60} />
                        ) : (
                            <Text variant="headlineSmall" style={{ fontWeight: 'bold', color: theme.colors.primary }}>
                                {pricing.currency}{pricing.total * settings.copies}
                            </Text>
                        )}
                    </View>
                    <Button
                        mode="contained"
                        onPress={handleProceed}
                        style={{ paddingHorizontal: 24 }}
                        contentStyle={{ height: 48 }}
                        disabled={isPricingLoading}
                    >
                        Proceed to Pay
                    </Button>
                </View>
            )}

            {/* Preview Modal */}
            <Modal
                visible={isPreviewVisible}
                animationType="slide"
                presentationStyle="pageSheet"
                onRequestClose={() => setIsPreviewVisible(false)}
            >
                <View style={styles.modalContainer}>
                    {/* Modal Header */}
                    <View style={styles.modalHeader}>
                        <Text variant="titleMedium" style={{ fontWeight: 'bold' }}>Print Preview</Text>
                        <IconButton
                            icon="close"
                            size={24}
                            onPress={() => setIsPreviewVisible(false)}
                            style={{ margin: 0 }}
                        />
                    </View>

                    {/* Preview Content */}
                    <View style={styles.modalContent}>
                        <View style={[
                            styles.fullPreviewPage,
                            settings.orientation === 'landscape' ? styles.fullPreviewLandscape : styles.fullPreviewPortrait
                        ]}>
                            {/* Actual Content Render for Modal */}
                            <View style={{ flex: 1, width: '100%' }}>
                                {fileType === 'pdf' ? (
                                    settings.pagesPerSheet > 1 ? (
                                        // N-up layout - show multiple pages per sheet
                                        <View style={{
                                            flex: 1,
                                            backgroundColor: 'white',
                                            padding: 8,
                                            flexDirection: settings.pagesPerSheet === 2 ? 'column' : 'row',
                                            flexWrap: 'wrap',
                                            gap: 4
                                        }}>
                                            {Array.from({ length: settings.pagesPerSheet }, (_, i) => (
                                                <View
                                                    key={i}
                                                    style={{
                                                        width: settings.pagesPerSheet === 2 ? '100%' : '49%',
                                                        height: settings.pagesPerSheet === 2 ? '49%' : '49%',
                                                        backgroundColor: '#f5f5f5',
                                                        overflow: 'hidden'
                                                    }}
                                                >
                                                    <Pdf
                                                        source={{ uri: document.uri, cache: true }}
                                                        style={{ flex: 1, width: '100%', height: '100%' }}
                                                        fitPolicy={0}
                                                        page={currentPreviewPage + i}
                                                        singlePage={true}
                                                        trustAllCerts={false}
                                                        onError={(error) => console.log('PDF Error:', error)}
                                                    />
                                                </View>
                                            ))}
                                        </View>
                                    ) : (
                                        // Single page view
                                        <View style={{ flex: 1, backgroundColor: 'white' }}>
                                            <Pdf
                                                source={{ uri: document.uri, cache: true }}
                                                style={{ flex: 1, width: '100%', height: '100%' }}
                                                fitPolicy={0}
                                                page={currentPreviewPage}
                                                singlePage={true}
                                                trustAllCerts={false}
                                                onError={(error) => console.log('PDF Modal Error:', error)}
                                                onLoadComplete={(numberOfPages) => {
                                                    console.log(`PDF loaded: ${numberOfPages} pages`);
                                                }}
                                            />
                                        </View>
                                    )
                                ) : fileType === 'image' ? (
                                    <View style={{ flex: 1, backgroundColor: 'white', justifyContent: 'center', alignItems: 'center' }}>
                                        <Image
                                            source={{ uri: document.uri }}
                                            style={{ width: '100%', height: '100%' }}
                                            resizeMode="contain"
                                        />
                                    </View>
                                ) : (
                                    <View style={{ flex: 1, justifyContent: 'center', alignItems: 'center', width: '100%', padding: 20, backgroundColor: 'white' }}>
                                        <Icon
                                            name={fileType === 'doc' ? 'file-word' : fileType === 'slide' ? 'file-powerpoint' : 'file-document'}
                                            size={64}
                                            color={fileType === 'doc' ? '#2B579A' : fileType === 'slide' ? '#D24726' : '#999'}
                                        />
                                        <Text variant="titleMedium" style={{ color: '#666', marginTop: 16, textAlign: 'center' }}>
                                            Preview not supported for {fileType.toUpperCase()}
                                        </Text>
                                        <Text variant="bodySmall" style={{ color: '#999', marginTop: 8, textAlign: 'center' }}>
                                            Please rely on the document name and settings.
                                        </Text>
                                    </View>
                                )}

                                {/* B&W Overlay - Simulates grayscale printing */}
                                {settings.colorMode === 'bw' && (fileType === 'pdf' || fileType === 'image') && (
                                    <View style={{
                                        ...StyleSheet.absoluteFillObject,
                                        backgroundColor: 'rgba(100,100,100,0.2)',
                                        pointerEvents: 'none'
                                    }} />
                                )}

                                {/* Page Navigation for PDFs */}
                                {fileType === 'pdf' && (
                                    <View style={{
                                        position: 'absolute',
                                        bottom: 16,
                                        left: 0,
                                        right: 0,
                                        flexDirection: 'row',
                                        justifyContent: 'center',
                                        alignItems: 'center',
                                        gap: 16
                                    }}>
                                        <TouchableOpacity
                                            style={{
                                                backgroundColor: 'rgba(0,0,0,0.7)',
                                                width: 36,
                                                height: 36,
                                                borderRadius: 18,
                                                justifyContent: 'center',
                                                alignItems: 'center'
                                            }}
                                            onPress={() => setCurrentPreviewPage(Math.max(1, currentPreviewPage - (settings.pagesPerSheet || 1)))}
                                            disabled={currentPreviewPage <= 1}
                                        >
                                            <Icon name="chevron-left" size={24} color="white" />
                                        </TouchableOpacity>

                                        <View style={{
                                            backgroundColor: 'rgba(0,0,0,0.7)',
                                            paddingHorizontal: 12,
                                            paddingVertical: 6,
                                            borderRadius: 16
                                        }}>
                                            <Text style={{ color: 'white', fontSize: 12, fontWeight: 'bold' }}>
                                                {settings.pagesPerSheet > 1
                                                    ? `Pages ${currentPreviewPage}-${Math.min(currentPreviewPage + settings.pagesPerSheet - 1, settings.totalPages)}`
                                                    : `Page ${currentPreviewPage}`
                                                }
                                            </Text>
                                        </View>

                                        <TouchableOpacity
                                            style={{
                                                backgroundColor: 'rgba(0,0,0,0.7)',
                                                width: 36,
                                                height: 36,
                                                borderRadius: 18,
                                                justifyContent: 'center',
                                                alignItems: 'center'
                                            }}
                                            onPress={() => setCurrentPreviewPage(Math.min(settings.totalPages, currentPreviewPage + (settings.pagesPerSheet || 1)))}
                                            disabled={currentPreviewPage >= settings.totalPages}
                                        >
                                            <Icon name="chevron-right" size={24} color="white" />
                                        </TouchableOpacity>
                                    </View>
                                )}
                            </View>

                            {/* Watermark / Overlay info */}
                            <View style={styles.watermarkContainer}>
                                <Text style={styles.watermarkText}>
                                    {settings.colorMode === 'bw' ? 'Black & White' : 'Color'}
                                </Text>
                            </View>
                        </View>

                        <View style={{ marginTop: 16, alignItems: 'center' }}>
                            <Text style={{ color: '#666', fontSize: 12, textAlign: 'center' }}>
                                {fileType === 'pdf' && settings.pageRange !== 'all'
                                    ? `Printing pages: ${settings.pageRange} (${parsePageRange(settings.pageRange, settings.totalPages)} pages)`
                                    : `${settings.pageSize} ${settings.orientation}`
                                }
                            </Text>
                            {fileType === 'pdf' && settings.pageRange !== 'all' && (
                                <Text style={{ color: '#999', fontSize: 10, marginTop: 4 }}>
                                    Use arrows to preview selected pages
                                </Text>
                            )}
                        </View>

                        <View style={styles.previewStats}>
                            <Chip icon="file-document-outline">
                                {fileType === 'image' ? '1' : parsePageRange(settings.pageRange, settings.totalPages)} Pages
                            </Chip>
                            <Chip icon="page-layout-sidebar-right">{settings.sides === 'double' ? 'Duplex' : 'Simplex'}</Chip>
                            <Chip icon="palette-outline">{settings.colorMode === 'color' ? 'Color' : 'B&W'}</Chip>
                        </View>
                    </View>
                </View>
            </Modal>

            <Snackbar
                visible={!!errorMsg}
                onDismiss={() => setErrorMsg(null)}
                action={{ label: 'Dismiss', onPress: () => setErrorMsg(null) }}
            >
                {errorMsg}
            </Snackbar>
        </View>
    );
};

const styles = StyleSheet.create({
    container: { flex: 1, backgroundColor: '#F4F5F9' },
    content: { flex: 1, padding: 16 },
    // ... existing styles ...
    settingsSection: { flex: 1 },
    tabs: { marginBottom: 16 },
    settingsGrid: { gap: 12 },
    settingRow: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
